import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './index.css';
import App from './App';
import SimpleForm from './pages/create/SimpleForm';
import reportWebVitals from './reportWebVitals';

const Root = () => (
  <React.StrictMode>
    <Router>
      <Switch>
        {/* The "/" route renders the App component */}
        <Route exact path="/" component={App} />

        {/* The "/create" route renders the SimpleForm component */}
        <Route path="/create" component={SimpleForm} />
      </Switch>
    </Router>
  </React.StrictMode>
);

// Render the Root component to the DOM
ReactDOM.createRoot(document.getElementById('root')).render(<Root />);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
